import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App/App.css';


import { Home } from './Home';
import { Aula1 } from './Aule/Aula1';
import { Aula2 } from './Aule/Aula2';
import { Aula3 } from './Aule/Aula3';
import { Aula4 } from './Aule/Aula4';


const App: React.FC = () => {

  return (
      <BrowserRouter>
        <Switch> 
          <Route path='/' exact component={Home}/>
          <Route path='/aula1' exact component={Aula1}/>
          <Route path='/aula2' exact component={Aula2}/>
          <Route path='/aula3' exact component={Aula3}/>
          <Route path='/aula4' exact component={Aula4}/>
          <Route path='/' render= {() => <div>Error 404</div>}/>
        </Switch>
      </BrowserRouter>
      
  );
}

export default App;
